import React from 'react';
import '../styles/Services.css';

class Services extends React.Component {
  render() {
    return (
      <div className="services-container">
        <h1>Our Services</h1>
        <p>Our services include website and app development, digital content creation, ad creation, and the provision of testing frameworks. We use a variety of technologies to ensure we provide our clients with the best possible service. Contact us today to learn more about how we can help with your tech needs.</p>
      </div>
    );
  }
}

export default Services;
